-- ----------------------------
--  Table structure for `device`
-- ----------------------------
DROP TABLE IF EXISTS `device`;
CREATE TABLE `device` (
  `device_id` int(11) NOT NULL AUTO_INCREMENT,
  `site_id` int(11) NOT NULL COMMENT 'FK to site table',
  `name` varchar(100) NOT NULL,
  `description` varchar(1000) DEFAULT NULL,
  `device_code` varchar(12) DEFAULT NULL,
  `system_port` int(11) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0=inactive',
  PRIMARY KEY (`device_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `export`
-- ----------------------------
DROP TABLE IF EXISTS `export`;
CREATE TABLE `export` (
  `export_id` int(11) NOT NULL AUTO_INCREMENT,
  `site_id` int(11) NOT NULL,
  `mate_sys_time` int(11) NOT NULL,
  `sys_batt_v` float NOT NULL,
  `created_date` datetime NOT NULL,
  PRIMARY KEY (`export_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3375 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `export_data`
-- ----------------------------
DROP TABLE IF EXISTS `export_data`;
CREATE TABLE `export_data` (
  `capture_id` int(11) NOT NULL AUTO_INCREMENT,
  `mate_sys_time` int(11) NOT NULL,
  `site_id` int(11) NOT NULL,
  `port` varchar(255) NOT NULL,
  `out_i` float NOT NULL,
  `in_i` float NOT NULL,
  `batt_v` float NOT NULL,
  `in_v` float NOT NULL,
  `out_kwh` float NOT NULL,
  `out_ah` float NOT NULL,
  `cc_mode` varchar(255) NOT NULL,
  `error` varchar(255) NOT NULL,
  `created_date` datetime DEFAULT NULL,
  PRIMARY KEY (`capture_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6441 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `number`
-- ----------------------------
DROP TABLE IF EXISTS `number`;
CREATE TABLE `number` (
  `hour` int(2) NOT NULL,
  PRIMARY KEY (`hour`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- ----------------------------
--  Records of `number`
-- ----------------------------
